// Home.jsx
import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className="home-container">
      <div className="home-content">
        <h1>We provide medical services that you can trust!</h1>
        <p>Our team of professionals is dedicated to providing the best healthcare services for you and your loved ones.</p>
      </div>
    </div>
  );
}

export default Home;
